function mySearch(){document.getElementById("myDropdown").classList.toggle("show")}function filterFunction(){var d,g,f,b,c,e;d=document.getElementById("myInput");g=d.value.toUpperCase();div=document.getElementById("myDropdown");c=div.getElementsByTagName("a");for(e=0;e<c.length;e++){if(c[e].innerHTML.toUpperCase().indexOf(g)>-1){c[e].style.display=""}else{c[e].style.display="none"}}}function myFunction(){var a,c,d,e,f,b;a=document.getElementById("myInput");c=a.value.toUpperCase();d=document.getElementById("myTable");e=d.getElementsByTagName("tr");for(b=0;b<e.length;b++){f=e[b].getElementsByTagName("td")[1];if(f){if(f.innerHTML.toUpperCase().indexOf(c)>-1){e[b].style.display=""}else{e[b].style.display="none"}}}}function sortTable(a){var j,k,b,e,h,g,f,c,d=0;j=document.getElementById("myTable");b=true;c="asc";while(b){b=false;k=j.getElementsByTagName("TR");for(e=1;e<(k.length-1);e++){f=false;h=k[e].getElementsByTagName("TD")[a];g=k[e+1].getElementsByTagName("TD")[a];if(c=="asc"){if(h.innerHTML.toLowerCase()>g.innerHTML.toLowerCase()){f=true;break}}else{if(c=="desc"){if(h.innerHTML.toLowerCase()<g.innerHTML.toLowerCase()){f=true;break}}}}if(f){k[e].parentNode.insertBefore(k[e+1],k[e]);b=true;d++}else{if(d==0&&c=="asc"){c="desc";b=true}}}};